import './TodoList.css';
import './TodoItem.css';
// import TodoItem from './TodoItem';

const TodoList = ({ todo }) => {
  return(
    <div className="TodoList">
      <h4>Todo List âœ…</h4>
      <input className="searchbar" placeholder=" Search List"/>
      <div className='list_wrapper'>
        {/* <TodoItem/>
        <TodoItem/>
        <TodoItem/> */}
        {
          todo.map((it) => (
          <div className='TodoItem'>
            <div className='checkbox_col'>{it.isDone}
              <input type="checkbox"/>
            </div>
            <div className="title_col">{it.content}</div>
            <div className="date_col">{it.createDate}</div>
            <div className='btn_col'>
              <button>Del</button>
            </div>
          </div>
          ))
        }
      </div>

    </div>

  );
}

export default TodoList;
